<?php	require_once ("\../lib\\common\\dao\\VO.class.php");	class Projectstat extends VO {		private $projectVO;		private $categoryVO;		private $timedimensionVO;		private $projectid;		private $categoryid;		private $timeid;		private $statdata;		public function setProject($projectVO){			$this->projectVO=$projectVO;		}		public function getProject(){			return $this->projectVO;		}		public function setCategory($categoryVO){			$this->categoryVO=$categoryVO;		}		public function getCategory(){			return $this->categoryVO;		}		public function setTimedimension($timedimensionVO){			$this->timedimensionVO=$timedimensionVO;		}		public function getTimedimension(){			return $this->timedimensionVO;		}		public function setProjectid($projectid){			$this->projectid=$projectid;		}		public function getProjectid(){			return $this->projectid;		}		public function setCategoryid($categoryid){			$this->categoryid=$categoryid;		}		public function getCategoryid(){			return $this->categoryid;		}		public function setTimeid($timeid){			$this->timeid=$timeid;		}		public function getTimeid(){			return $this->timeid;		}		public function setStatdata($statdata){			$this->statdata=$statdata;		}		public function getStatdata(){			return $this->statdata;		}		public function __toString(){			return "projectid=".$this->projectid."(".$this->projectVO.")".", categoryid=".$this->categoryid."(".$this->categoryVO.")".", timeid=".$this->timeid."(".$this->timedimensionVO.")".", statdata=".$this->statdata;		}	}?>